import React, { useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import RegistrationForm from './components/RegistrationForm';
import ListadoAmenazas from './components/listado-amenazas';
import ListadoUsuarios from './components/listado-';
import './App.css';

import { UserProvider } from './UserContext';

const App = () => {
  useEffect(() => {
    document.title = 'SOC';
  }, []);

  return (
    <Router>
      <UserProvider>
      <Routes>
        <Route path="/listado-amenazas" element={<ListadoAmenazas />} />
        <Route path="/listado-usuarios" element={<ListadoUsuarios />} />
        <Route path="/registro" element={<RegistrationForm />} />
        <Route path="/" element={<LoginForm />} />
      </Routes>
      </UserProvider>
    </Router>
  );
}

export default App;
